import * as Dialog from "@radix-ui/react-dialog";
import { BoxAnnouncement, GridGames, Logo } from "../../components";
import { Container } from "./styles";

// Função que exporta a screen Home
export function Home() {
  return (
    <Container>
      <div data-testid="home-page">
        <Logo />
        <h1>
          Seu <span className="gradient">duo</span> está aqui.
        </h1>
        <GridGames />
        <Dialog.Root>
          <BoxAnnouncement />
          <Dialog.Portal>
            <Dialog.DialogOverlay />

            <Dialog.Content>
              <Dialog.DialogTitle>Publique um anúncio</Dialog.DialogTitle>

              <Dialog.Content>
                <p>teste</p>
              </Dialog.Content>
            </Dialog.Content>
          </Dialog.Portal>
        </Dialog.Root>
      </div>
    </Container>
  );
}
